import { observable, action } from "mobx";

export class VehicleStore {
    @observable vehicle: object = {}

    @action
    loadVehicle = () => {
        getVehicle.then(this.vehicle = vehicle)
    }

    @action 
    addVehicle = (vehicle: object) => {
        this.vehicle = vehicle
    }
}
